export class IrmFoie
{
    IrmfoieId:number;
    PatientId:number;
    DateIrm:string;
    Ft2:number;
    ConcentrationHepatiqueFer:number;
    Fr2;
    constructor()
    {
        this.IrmfoieId=0;
        this.PatientId=0;
        this.DateIrm='';
        this.Ft2=0;
        this.ConcentrationHepatiqueFer=0;
        this.Fr2=0;

    }
}
